import './expenseItem.css'
function Expense(pro)
{
    const expenseDate=new Date(2022 ,4 ,21)
    const expenseTitle="Car Insurance"
    const expenseAmount=250.90
    return(<div className="expense-item"><div className="expense-item__description">{expenseDate.toISOString()}</div>
    <div>
        <div className="expense-item__description h2"><h2>{expenseTitle}</h2></div><div className="expense-item__price">Rs.{expenseAmount}</div>
    </div></div>)
    
    
  
    
}
export default Expense
